го успев разрядить батарею с завода и зарядить один раз. Сейчас имею проблему с остановкой при работе с двигателем при полной зарядке аккумулятора. Двигатель при включении работает секунды 3-4 потом стопор и это без нагрузки. При этом батарея держит хорошо. Запах гари при этом усиливается. Работать не возможно. Понятно, что гарантийный случай но, что делать с гарантией сам не знаю. Гарантийной мастерской в моем городе нет. В гарантийном талоне что-то написано телефон не работае. Остается написать отзыв и предупредить пользователей с гарантией могут быть проблемы. Сам магазин не решит проблему два отказа в рассмотрении это уже показатель. Рекомендую покупать убедившись если сервис есть.", "2020-10-15T09:13:51Z", "черный, желтый", "0", 3, 0, 1, "Дрель-шуруповерт аккумуляторная DKCD20FU Li-Ion, 42 Нм, 20В, 1х1.5 А*ч, з/у", "DEKO"], "196": ["Офигенный аппаратик! Шустрый, качественный! Ребят, берите, не сомневайтесь👍", "2020-10-09T09:10:17Z", "черный, желтый", "0", 0, 1, 5, "Дрель-шуруповерт аккумуляторная DKCD20FU Li-Ion, 42 Нм, 20В, 1х1.5 А*ч, з/у", "DEKO"], "199": ["Патрон лювтит сильно.друг заказал в в прошлом году такой же но с кэйсом . У него  лювта нет", "2020-10-06T16:35:27Z", "черный, желтый", "0", 1, 1, 3, "Дрель-шуруповерт аккумуляторная DKCD20FU Li-Ion, 42 Нм, 20В, 1х1.5 А*ч, з/у", "DEKO"], "200": ["На первый взгляд все отлично, работает хорошо, посмотрим как себя в дальнейшем покажет", "2020-10-05T23:55:09Z", "черный, желтый", "0", 1, 0, 5, "Дрель-шуруповерт аккумуляторная DKCD20FU Li-Ion, 42 Нм, 20В, 1х1.5 А*ч, з/у", "DEKO"], "206": ["Шурик реально крутой, не хуже Макита или Метабо, есть нюансы, но они незначительные. Полностью им сделал крышу 150 кв.м. Никаких проблем, все залетает как по маслу.", "2020-10-02T07:54:09Z", "черный, желтый", "0", 2, 0, 5, "Дрель-шуруповерт аккумуляторная DKCD20FU Li-Ion, 42 Нм, 20В, 1х1.5 А*ч, з/у", "DEKO"], "211": ["Двигатель искрит , это очень плохо , посмотрим сколько прослужит , гарантию не оформляют (((", "2020-09-27T05:37:48Z", "черный, желтый", "0", 1, 2, 1, "Дрель-шуруповерт аккумуляторная DKCD20FU Li-Ion, 42 Нм, 20В, 1х1.5 А*ч, з/у", "DEKO"], "221": ["Купил со скидкой за 1800 рублей. Ухватистая ручка, две скорости, подсвевтка, реверс, неплохой аккумулятор с зарядкой, хорошее усилие. За эти деньги очень неплохо.", "2020-09-16T15:51:33Z", "черный, желтый", "0", 2, 0, 5, "Дрель-шуруповерт аккумуляторная DKCD20FU Li-Ion, 42 Нм, 20В, 1х1.5 А*ч, з/у", "DEKO"], "223": ["Шурик хороший удобный, жаль что первый был с браком пришлось перезаказывать,", "2020-09-15T18:01:18Z", "черный, желтый", "0", 0, 1, 5, "Дрель-шуруповерт аккумуляторная DKCD20FU Li-Ion, 42 Нм, 20В, 1х1.5 А*ч, з/у", "DEKO"], "224": ["Огонь, детский шурик с нереальным моментом, рисовые инжинеры постарались на славу.", "2020-09-15T17:34:04Z", "черный, желтый", "0", 1, 0, 5, "Дрель-шуруповерт аккумуляторная DKCD20FU Li-Ion, 42 Нм, 20В, 1х1.5 А*ч, з/у", "DEKO"], "227": ["Отличный шурик за свою стоимость! Аккумулятор оооочень долго работает. Комфортный в руке. Муж говорит, что одно удовольствие с ним работать. Для дома самое то.", "2020-09-13T14:47:00Z", "черный, желтый", "0", 1, 0, 5, "Дрель-шуруповерт аккумуляторная DKCD20FU Li-Ion, 42 Нм, 20В, 1х1.5 А*ч, з/у", "DEKO"], "229": ["Всё работает отлично. За 2100 очень даже ничего.", "2020-09-11T10:31:40Z", "черный, желтый", "0", 1, 0, 5, "Дрель-шуруповерт аккумуляторная DKCD20FU Li-Ion, 42 Нм, 20В, 1х1.5 А*ч, з/у", "DEKO"], "233": ["Всё работает. Нет биты и фонарик светит не ярко и не на рабочую поверхность, а ниже. В целом, мужу понравился.", "2020-09-05T06:42:12Z", "черный, желтый", "0", 0, 1, 5, "Дрель-шуруповерт аккумуляторная DKCD20FU Li-Ion, 42 Нм, 20В, 1х1.5 А*ч, з/у", "DEKO"], "234": ["Маленький... Думал больше будет, 3х летняя макита по крупнее.... Все целое, даже крепенький такой, по вольтажу все совпадает (аккум и зарядка по 20v). Пришёл запакованный, все целое замечаний нет.", "2020-09-04T11:46:24Z", "черный, желтый", "0", 1, 1, 5, "Дрель-шуруповерт аккумуляторная D